INSERT INTO `tickets` VALUES (1,'「璀璨星河」流行音乐巡回演唱会','一场汇集了年度最火流行歌手的音乐盛宴，带你领略最前沿的音乐潮流。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(2,'「摇滚不朽」经典摇滚乐队之夜','致敬传奇，重温经典。多支老牌摇滚乐队将带你回到那个黄金年代。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(3,'城市篮球联赛总决赛：巅峰对决','年度最激烈的篮球对决，见证冠军的诞生！','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(5,'《代码人生》沉浸式科技艺术展','结合了光影、代码与交互装置的未来主义展览，让你感受科技之美。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(6,'国际古典音乐会：肖邦之夜','由世界级钢琴家演奏的肖邦经典作品，一场听觉的盛宴。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(7,'开心麻花经典爆笑舞台剧《乌龙山伯爵》','经典喜剧，包袱不断，让你从头笑到尾。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(8,'世界电子竞技大赛（WEC）全球总决赛','顶尖战队的终极较量，电竞迷不可错过的年度盛事。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(9,'梵高《星空》主题数字艺术展','通过数字技术，让你走进梵高的画作，感受艺术家的内心世界。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(10,'国家话剧院年度大戏《茶馆》','老舍先生经典作品，再现时代变迁中的众生相。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(11,'「民谣在路上」音乐节','多位知名民谣歌手齐聚，用音乐讲述生活的故事。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(12,'国际足球友谊赛：雄狮队 vs 猛虎队','一场激动人心的足球对决，看绿茵场上的速度与激情。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(13,'儿童音乐剧《冰雪奇缘》中文版','迪士尼经典动画改编，带孩子们进入一个奇幻的冰雪王国。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(14,'「东方神韵」中国风电子音乐派对','将传统国风元素与现代电子音乐完美融合的创新派对。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(15,'德云社相声专场演出','听云鹤九霄，品百味人生。一场充满欢声笑语的相声表演。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(16,'城市马拉松报名','挑战自我，跑出激情！一年一度的城市体育盛会。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(17,'《三体》主题科幻体验展','基于刘慈欣著名科幻小说打造的沉浸式体验，带你探索宏大的三体宇宙。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(18,'爵士音乐节：即兴之夜','慵懒的旋律，自由的节奏，享受一个纯粹的爵士乐之夜。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(19,'世界顶级综合格斗冠军赛（MMA）','力量与技巧的碰撞，感受八角笼内的热血与汗水。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670'),(20,'「国潮来袭」汉服文化节','展示传统服饰之美，体验古代文化风情。','2025-10-02 07:07:17.670','2025-10-02 07:07:17.670');
